import React, { Component } from "react";
import RemoveTaskButton from "./../buttonComponents/RemoveTaskButton";

const style = {
  container: {
    width: "50%",
    minHeight: "40%",
    paddingTop: 30,
    paddingBottom: 30,
    paddingLeft: 15,
    paddingRight: 15,
    backgroundColor: "#F5F5F5",
    borderRadius: 10,
    marginTop: 15,
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "space-around",
    position: "relative"
  },
  text: {
    margin: 0,
    padding: 0,
    fontWeight: "lighter",
    fontSize: 20,
    marginBottom: 10
  },
};

export class TaskInputField extends Component {
  constructor(props) {
    super(props)
  }

  state = {};

  render() {
    const { text } = this.props;
    return (
      <div style={style.container}>
        <h6 style={style.text}>{text}</h6>
        <input placeholder='Task description'/>
      </div>
    );
  }
}

export default TaskInputField;
